import { Email, Lock, Person } from '@mui/icons-material';
import React from 'react';
import './register.css'
import { Link } from 'react-router-dom';
export default function Register() {
  const sendEmail = (e) => {
    e.preventDefault();
  };
    return (
        <div className='RegisterTop'>
            <form action='' className='RegisterForm' onSubmit={sendEmail}>
            <h1 >Register</h1>
                <div className='RegisterInput'>
                    <input type='text' placeholder='Prénom' />
                    <Person className='iconsRegister' />
                </div>
                <div className='RegisterInput'>
                    <input type='text' placeholder='Nom' />
                    <Person className='iconsRegister' />
                </div>
            <div className='RegisterInput'>
                <input type='text' placeholder='Nom d’utilisateur' />
                <Person className='iconsRegister' />
            </div>
            <div className='RegisterInput'>
                <input type='email' placeholder='E_mail' />
                <Email className='iconsRegister' />
            </div>
            <div className='RegisterInput'>
                <input type='password' placeholder='Mot de passe' />
                <Lock className='iconsRegister' />
            </div>
            <button type='submit'>Register</button>
            <div className='LoginLink'>
                <p >Avez-vous un compte ? <Link to={'/login'}>Login</Link></p>
            </div>
            </form>
        </div>
    );
}
